import React from 'react'
import './WelcomeBox.css'

function WelcomeBox() {
    return (

        <div className='welcome-box'>


            <p className='welcome-title'>CHÀO MỪNG BẠN ĐẾN THƯ VIỆN MTA</p>
            <p className='welcome-message'>Mở cánh cửa tri thức với những trang sách đầy sức mạnh.<br/>
            <span className='welcome-submessage'>Sách - Hành trình tâm hồn, sức mạnh trí tuệ!</span></p>
        </div>
    )
}

export default WelcomeBox
